title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o6072.m3 -> o6021.m7 -> o6021.m17 -> o6072.m19 -> o6021.m13 -> o6021.m17
  o6072.m11 -> o6072.m2 -> o6021.m7 -> o6021.m17 -> o6072.m19 -> o6021.m13 -> o6021.m17
  o6021.m17 -> o6072.m19 -> o6021.m13 -> o6021.m17
  o6021.m13 -> o6021.m17 -> o6072.m19 -> o6021.m13
  o6072.m2 -> o6021.m7 -> o6021.m17 -> o6072.m19 -> o6021.m13 -> o6021.m17
  o6072.m8 -> o6021.m13 -> o6021.m17 -> o6072.m19 -> o6021.m13
  o6021.m14 -> o6072.m19 -> o6021.m13 -> o6021.m17 -> o6072.m19
  o6072.m19 -> o6021.m13 -> o6021.m17 -> o6072.m19
  o6021.m7 -> o6021.m17 -> o6072.m19 -> o6021.m13 -> o6021.m17
  o6072.m15 -> o6021.m13 -> o6021.m17 -> o6072.m19 -> o6021.m13

features:
  - inheritance
  - overriding
  - method
  - polymorphism

